import './Header.scss';

const Header = () => {
  return (
    <header className="header">
      <img className="logo" src="https://logowiki.net/wp-content/uploads/imgp/Graphics-and-Prints-Logo-1-6714.png" />
      <div><h1>Safe Life</h1></div>
    </header>
  )
}

export default Header;
